import { HomePage } from './pages/Home/home';
import { Signup } from './pages/About/signup';
import { Route, Routes } from 'react-router-dom';
function App() {
  const [myUser, setmyUser] = useState("ee");
  return (
    <>
    <Routes>



        <Route path="/" element={<HomePage  myUser={myUser} setmyUser={setUser}  />} />
        <Route path="signup" element={<Signup myUser={myUser} setmyUser={setmyUser} />} />

      </Routes>
    </>
  );
}
export default App;
